import React from 'react';
import MapOfParos from '../MapOfParos/MapOfParos';
import Photos from '../Photos/Photos';
import PhotosModel from '../../model/Photos';
import './Home.scss';

const Home : React.FC = props => {
    const photos = PhotosModel.getPhotos();

    return (
        <div className={`home`}>
            <header>
                <h2>welcome to</h2>
                <h1>Paros</h1>
            </header>
            <MapOfParos />
            <Photos photos={photos}/>
        </div>
    );
}

export default Home;
